import matplotlib.pyplot as plt
import numpy as np


def plot_distribution(mean, variance, samples, pdf=None):
    n, bins, patches = plt.hist(samples, bins=50, density=True)
    plt.axvline(mean, color='k', linestyle='dashed', linewidth=1)
    if pdf:
        plt.plot(*pdf(mean, variance, bins), '--')
    plt.show()



