def dist_gauss(mu, scale, pts):
    sigma = scale
    return pts, np.exp(-0.5 * ((pts - mu) / sigma)**2) / (np.sqrt(2 * np.pi) * sigma)
def dist_laplace(mu, scale, pts):
    return pts, (1 / (2 * scale)) * np.exp(-(np.abs(pts - mu) / scale))

distributions = [
    {"pdf": dist_gauss, "data": data_gauss},
    {"pdf": dist_laplace, "data": data_laplace},
]

